(1127, 'https://portal-images.azureedge.net/auctions-2023/suprem11762/images/b66059a8-0654-4bf7-81e0-b07a00bd9053.jpg?w=540&h=360', 'Pallet To Contain 8 x New & Boxed Ultimate Safe 27L 30BIOM Biometric Home Safe. Features MAXIMUM', 'https://www.bidspotter.co.uk//en-gb/auction-catalogues/supremeauctions/catalogue-id-suprem11762/lot-93a2b0fd-4507-4bc9-adc4-b07a00bd4bb6', 'live', '2023-09-25 19:30:40', 'Pallet To Contain 8 x New & Boxed Ultimate Safe 27L 30BIOM Biometric Home Safe. Features\nMAXIMUM SECURITY - when you choose an Ultimate Safe, you can be sure that you are purchasing an item that has been designed with the highest security in mind. This biometric home safe features our unique Triple Blade Lock with three 0.8\" thick dead bolts. The body of the safe is reinforced and features an extended structural frame with dedicated insertion slots for the locking bolts which protects against pry bar brute force attack.  \nDEPENDABLE AUTHENTICATION - the semiconductor live fingerprint identification module ensures quick and accurate authentication for access. Just place your finger on the reader and you are instantly granted access to your handgun or valuables. The integrated indicator light provides status information via three color codes: green, yellow, and red. Scan and store up to 50 fingerprints for multiple persons.  \nBACKUP ACCESS - your safe comes with two backup access methods, a digital and a mechanical one. You can set two access PIN codes or use the keypad to open the safe. You also have a physical emergency override key (two keys supplied), which goes into a hidden key hole on the front.\nUPSCALE FINISHES AND FEATURES - this safe is as beautiful on the inside, as it is on the outside. On the outside you will find a special effect textured leather powder coating, which is incredibly strong and purposeful (scratch resistant). The inside is fully lined with soft material to be gentle on your valuables and gives a luxurious feel. An adjustable removable shelf and an LED light that comes on automatically when the safe is opened.  \nEASY INSTALLATION - your biometric home safe can be fixed to the wall or floor in a secured location for better protection. Comes with 4 pre-drilled holes in the back and base, along with fixing bolts and instructions. A clear and easy-to-understand manual. External dimensions: 12\" (H) x 15\" (W) x 12\" (D).  \n \n\nDetailed Information\nThe Ultimate Safe 30BIOM biometric home safe is designed to offer the ultimate protection for your valuables. Our clients trust these safes to store handguns, ammunition, jewelry, identity and other sensitive documents, money, bank cards, electronic devices, RSA authenticator key fobs, keys, and other items.', 0, 20, 'not yet met', 4, 'Supreme Auctions', '2023-09-07'),
(1128, 'https://portal-images.azureedge.net/auctions-2023/pr10415/images/47fc45bb-0558-46aa-a84a-b07f014eeb8d.jpg?w=540&h=360', 'A velveteen two seater sofa 160 x 90 x 66cm complete with a pair of Potocco Italy chairs and a', 'https://www.bidspotter.co.uk//en-gb/auction-catalogues/pro-auction/catalogue-id-pr10415/lot-e147c5e8-c3c5-4239-a7f8-b07f012c3665', 'live', '2023-09-23 01:39:34', 'A velveteen two seater sofa 160 x 90 x 66cm complete with a pair of Potocco Italy chairs and a wooden coffee table 100 x 60 x 50cm ( Location: James Braid )', 0, 60, 'reserve met', 0, 'Pro Auction Limited', '2023-09-27'),
