(1130, 'https://portal-images.azureedge.net/auctions-2023/suprem11762/images/010278d1-88c0-4325-bb7f-b07a00bd8cf6.jpg?w=540&h=360', 'Pallet To Contain 8 x New & Boxed Ultimate Safe® 43L 50BIOM Biometric Home Safe. Features: MAXIMUM', 'https://www.bidspotter.co.uk//en-gb/auction-catalogues/supremeauctions/catalogue-id-suprem11762/lot-1e5b0787-fd85-4eb2-a393-b07a00bd4bb6', 'live', '2023-09-25 19:30:20', 'Pallet To Contain 8 x New & Boxed Ultimate Safe® 43L 50BIOM Biometric Home Safe. Features:\nMAXIMUM SECURITY - when you choose an Ultimate Safe®, you can be sure that you are purchasing an item that has been designed with the highest security in mind. This biometric home safe features our unique Triple Blade Lock® with three 0.8\" thick dead bolts. The body of the safe is reinforced and features an extended structural frame with dedicated insertion slots for the locking bolts which protects against pry bar brute force attack.\nDEPENDABLE AUTHENTICATION - the semiconductor live fingerprint identification module ensures quick and accurate authentication for access. Just place your finger on the reader and you are instantly granted access to your handgun or valuables. The integrated indicator light provides status information via three color codes: green, yellow, and red. Scan and store up to 50 fingerprints for multiple persons.  \nBACKUP ACCESS - your safe comes with two backup access methods, a digital and a mechanical one. You can set two access PIN codes or use the keypad to open the safe. You also have a physical emergency override key (two keys supplied), which goes into a hidden key hole on the front.  \nUPSCALE FINISHES AND FEATURES - this safe is as beautiful on the inside, as it is on the outside. On the outside you will find a special effect textured leather powder coating, which is incredibly strong and purposeful (scratch resistant). The inside is fully lined with soft material to be gentle on your valuables and gives a luxurious feel. Adjustable removable shelves and an LED light that comes on automatically when the safe is opened.  \nEASY INSTALLATION - your biometric home safe can be fixed to the wall or floor in a secured location for better protection. Comes with 4 pre-drilled holes in the back and base, along with fixing bolts and instructions. A clear and easy-to-understand manual. External dimensions: 50cm (H) * 35cm (W) * 31cm (D).  \nThe Ultimate Safe® Biometric Safe Is The Most Secure Biometric Safe at This Price Point.   \nA common failure point for ALL biometric safes (other than Ultimate Safe Models) is their weak frame, which can bend under an applied force. The body of all Ultimate Safe® biometric models are made from premium steel with a 1.5mm body thickness, the frame has been designed to be stiffer and features integrated insertion slots for the locking pins, making it virtually impossible to have any sort of leverage to be applied or be able to force your way in. Ultimate Safe® has created and designed this unique feature which is protected by intellectual property rights. \n\nUltimate Safe® 43L biometric safe with integrated slots for the locking pins', 0, 20, 'not yet met', 6, 'Supreme Auctions', '2023-09-07'),
